import React from "react";
import { Navigate, useParams } from "react-router-dom";

import "./Item.css";

const Item = ({items}) => {
  let {itemId} = useParams();
  const item = items.find((item) => item.id === itemId);
  if (item === undefined) {
    return <Navigate to="/"></Navigate>
  }
};

export default Item;
